// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import FoodForm from '.com/FoodForm';
import AddFoodPage from '.component/AddFoodPage'; // Import the new page component

const App = () => {
  const fetchFoods = () => {
    // Function to fetch foods
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/add">Add Food</Link> {/* Add link to navigate to the new page */}
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact>
            <FoodForm fetchFoods={fetchFoods} />
          </Route>
          <Route path="/add">
            <AddFoodPage fetchFoods={fetchFoods} /> {/* Render the new page component */}
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
